import React from 'react';
import { Typography, Link, Grid, CssBaseline, Paper, Avatar, TextField, Button, Box, Container } from '@mui/material';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Head from '../../composants/Head/index.jsx';

// Composant MadeWithLove
const MadeWithLove = () => (
    <Typography variant="body2" color="textSecondary" align="center">
        {'Built with love by the '}
        <Link color="inherit" href="https://material-ui.com/">
            Material-UI
        </Link>
        {' team.'}
    </Typography>
);

// Composant SignUpSide
const SignUpSide = () => {
    return (
        <>
            <Head />
            <Container component="main" maxWidth="xs">
                <CssBaseline />
                <Box sx={{
                    marginTop: 8,
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                }}>
                    <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
                        <LockOutlinedIcon />
                    </Avatar>
                    <Typography component="h1" variant="h5">
                        Sign in
                    </Typography>
                    <Box component="form" noValidate sx={{ mt: 1, width: '100%' }}>
                        <Grid container spacing={2}>
                            <Grid item xs={12} sm={6}>
                                <TextField required variant="outlined" fullWidth id="nom" label="Nom" name="nom" autoFocus />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField required variant="outlined" fullWidth id="prenom" label="Prénom" name="prenom" />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField required variant="outlined" fullWidth id="email" label="Email Address" name="email" autoComplete="email" />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField required variant="outlined" fullWidth id="password" label="Password" name="password" type="password" autoComplete="current-password" />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField required variant="outlined" fullWidth id="telephone" label="Téléphone" name="telephone" />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField required variant="outlined" fullWidth id="dateNaissance" label="Date de Naissance" name="dateNaissance" type="date" InputLabelProps={{ shrink: true }} />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField required variant="outlined" fullWidth id="lieuNaissance" label="Lieu de Naissance" name="lieuNaissance" />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField required variant="outlined" fullWidth id="regionResidence" label="Région de Résidence" name="regionResidence" />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField required variant="outlined" fullWidth id="profession" label="Profession" name="profession" />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField required variant="outlined" fullWidth id="nomEntreprise" label="Nom de l'Entreprise" name="nomEntreprise" />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField required variant="outlined" fullWidth id="chiffreAffaire" label="Chiffre d'Affaire" name="chiffreAffaire" type="number" />
                            </Grid>
                        </Grid>
                        <Button
                            type="submit"
                            fullWidth
                            variant="contained"
                            color="primary"
                            sx={{ mt: 3, mb: 2 }}
                        >
                            Sign In
                        </Button>
                        <Grid container justify="flex-end">
                            <Grid item>
                                <Link href="/" variant="body2">
                                    Already have an account? Sign in
                                </Link>
                            </Grid>
                        </Grid>
                        <MadeWithLove />
                    </Box>
                </Box>
            </Container>
        </>
    );
};

export default SignUpSide;
